    }
    const plansCollection = this.db.collection('plans');
    const plansCount = await plansCollection.countDocuments();
    return plansCount;
  }

}


async function mongodbConnector() {
  const dbClient = new DBClient();
  await dbClient.connect();
  return dbClient;
}

